export function rad2deg(rad: number): number {
  return (rad * 180) / Math.PI;
}

export function makeColor(hex: string, alpha?: number): ColorRGBA {
  const color = stringToRgba({ r: 0, g: 0, b: 0, a: 1 }, hex);
  if (alpha != undefined) {
    color.a = alpha;
  }
  return color;
}

/**
 * Pack RGBA values into a uint32 in the order expected by RViz:
 * https://github.com/ros-visualization/rviz/blob/a60b334fd10785a6b74893189fcebbd419d468e4/src/rviz/default_plugin/point_cloud_transformers.cpp#L400-L404
 */
export function packRvizRgba(r: number, g: number, b: number, a: number): number {
  return (
    (Math.trunc(a * 255) << 24) |
    (Math.trunc(r * 255) << 16) |
    (Math.trunc(g * 255) << 8) |
    Math.trunc(b * 255)
  );
}

export function makePass({
  id,
  stamp,
  frame_id,
  colorHex,
  description,
  ns = "pass",
  frame_locked = false,
  pose = { position: VEC3_ZERO, orientation: QUAT_IDENTITY },
  scale = VEC3_HALF,
  receiveTime = { sec: 10, nsec: 0 },
  lifetime = { sec: 0, nsec: 0 },
}: MarkerArgs): MessageEvent<Marker> {
  return {
    topic: "/markers",
    receiveTime,
    message: {
      header: { seq: 0, stamp, frame_id },
      id,
      ns,
      type: 1,
      action: 0,
      frame_locked,
      pose,
      scale,
      color: makeColor(colorHex, 0.25),
      lifetime,
      text: `pass${id}${description ? `: ${description}` : ""}`,
      points: [],
      colors: [],
      mesh_resource: "",
      mesh_use_embedded_materials: false,
    },
    schemaName: "visualization_msgs/Marker",
    sizeInBytes: 0,
  };
}

